import React from "react";
import Nav from "../nav/Nav";

const Header = (props) => {
  return (
    <header style={styles.header}>
      <h1 style={styles.h1}>{props.pgTitle}</h1>
      <Nav />
    </header>
  );
};

export default Header;

const styles = {
  header: {
    display: "flex",
    flextDirection: "row",
    backgroundColor: "#ccc",
    justifyContent: "space-between",
  },
  h1: {
    fontSize: "1.5rem",
    color: "#ff0000",
  },
};
